package helloworld;


public class 중첩for문 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,j;
		for(i = 1; i <= 10; i++) {
			System.out.println("--------------------------");
			for(j = 1; j <= 10; j++) {
				System.out.printf("%s - 자바 프로그래밍%s\n", i,j);
			}
		}
		
		

	}

}
